parameters.inputSchema:
{
  "type": "object",
  "properties": {
    "ppe_boolean": {
      "type": "boolean",
      "description": "Whether the person highlighted by the red detection box is wearing high-visibility PPE (safety vest, shirt, or jacket in neon yellow/green or construction orange)."
    },
    "ppe_confidence": {
      "type": "number",
      "minimum": 0,
      "maximum": 1,
      "description": "Confidence score between 0 and 1 that the boxed person is wearing high-visibility PPE as defined above."
    },
    "image_context": {
      "type": "string",
      "description": "A summary of what the model believes about the boxed person (e.g., clothing colors, visible gear, activity)."
    }
  },
  "required": ["ppe_boolean", "ppe_confidence", "image_context"]
}
